class Table
{
    constructor(value, options) {
        this.value=value
        this.options=options
    }
    toHTML() {
        throw new Error('Метод toHTML должен быть реализован')
    }
}
export class SoftwareTable extends Table
{
    constructor(value,options) {
        super(value,options);
    }

    toHTML(){

    }
}
export class ComputersTable extends Table
{
    constructor(value,options) {
        super(value,options);
    }
}
export class OfficeEquipmentTable extends Table
{
    constructor(value,options) {
        super(value,options);
    }
}
